function maxSubArrayLen(nums, k) {
    let mp = {0: -1};
    let s = 0;
    let ans = 0;
    for (let i = 0; i < nums.length; i++) {
        s += nums[i];
        if (mp[s - k] !== undefined) {
            ans = Math.max(ans, i - mp[s - k]);
        }
        if (mp[s] === undefined) {
            mp[s] = i;
        }
    }
    return ans;
}
